import React from "react";

function FormComponent(props){
  return (
    <form>
      <input
      //get session type
        type="radio"
        name="training"
        value="training"
        //checked={placeholder}
        //onChange={[placeholder]}
      /> Training
      <br />
      <input
        type="radio"
        name="climbing"
        //checked={placeholder}
        //onChange={[placeholder]}
      /> Climbing
      <br />

      //indoor or outdoor
      <input
        type="radio"
        name="indoor"
        //checked={placeholder}
        //onChange={[placeholder]}
      /> Indoor
      <br />
      <input
        type="radio"
        name="outdoor"
        //checked={placeholder}
        //onChange={[placeholder]}
      /> Outdoor
      <br />

      //type of climbing
      <input
        type="checkbox"
        name="boulder"
        //checked={placeholder}
        //onChange={[placeholder]}
      /> Bouldering
      <br />
      <input
        type="checkbox"
        name="toprope"
        //checked={placeholder}
        //onChange={[placeholder]}
      /> Top Rope
      <br />
      <input
        type="checkbox"
        name="lead"
        //checked={placeholder}
        //onChange={[placeholder]}
      /> Lead
      <br />
      <input
        type="checkbox"
        name="trad"
        //checked={placeholder}
        //onChange={[placeholder]}
      /> Trad
      <br />
    </form>
  )
}

export default FormComponent
